export class FoodItem {
    foodItemId!: number;
    name!: string;
    description!: string;
    price!: number;
    availableQuantity!: number;
    category!:Category;
    imagePath!:string;
    enabled!:boolean;
  }

  export class Category{
    categoryId!:number;
    name!:string;
  }
